import React from 'react';

class GenerateQuestions extends React.Component {
  constructor(){
    super();
    this.state = {quesans: []}
  }
//fetch to get the json
componentDidMount() {
  // Simple GET request using fetch
  fetch('http://localhost:3000/generate-questions')
      .then(response => response.json())
      .then(data => this.setState({ quesans: data }));
}
//parse

  render(){
    let quesans = this.state.quesans
    console.log(quesans)
    return (
      <div>
        <p>hello</p>
        <p>{quesans[0]}</p>
      </div>
    )
  }
}

export default GenerateQuestions;
